import React from "react";
import { projectsData } from "a";

const Projects = () => {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold text-center mb-6">Our Projects</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {projectsData.map((project) => (
          <div key={project._id} className="border rounded-lg shadow-lg p-4 flex flex-col items-center">
            <img src={project.img} alt={project.title} className="w-48 h-48 object-cover mb-4" />
            <h2 className="text-xl font-semibold">{project.title}</h2>
            <p className="text-gray-600">{project.category}</p>
            <p className="text-sm text-gray-500 mt-2">{project.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
